import React from "react";
import "./Developer.css";

export const Developer = () => {
  return (
    <div className = "Developer">
      <h1></h1>
      <div className="developers">
        <h4>
          This project is made by Saurabh Gupta and Ananya M. <br></br>Saurabh
          is Computer Science and Engineering Undergradute (B. Tech CSE
          (2020-24) @ IIITDM Kancheepuram) while Ananya M. is Computer Science
          and Artificial Intelligence Undergradute(B. Tech CS-AI (2021-25)
          @IIITDM Kancheepuram).{" "}
        </h4>
        <h4>
          Both together have created this Project under Dr. Ram Prasad Padhy Sir
          (Professor in Computer Science Field at IIITDM Kancheepuram) under his
          Course Artificial Intelligence.
        </h4>
      </div>
    </div>
  );
}
